code.value:
// Aux value not to modify orignal
rfeHwSpi_register32_t newRegisterValue = atbRegToAddValue;

// Do we need shift?
if( true == shiftNeeded)
{
    newRegisterValue = ( newRegisterValue & ~maskToApply ) | ( ( valueToSet << shiftToApply ) & maskToApply );
}
else
{
    newRegisterValue = ( newRegisterValue & ~maskToApply ) | ( valueToSet  & maskToApply );
}

#ifdef RFE_HW_ATB_DEBUG
sim_printf("[DEBUG] refeHwAtb_ctrlAtbSetValueThroughMask setting value %08x on register content %08x with bitmask %08x  and bit shift of %08x\n", valueToSet, atbRegToAddValue, maskToApply, shiftToApply);
sim_printf("[DEBUG] refeHwAtb_ctrlAtbSetValueThroughMask old register value %08x\n", atbRegToAddValue);
sim_printf("[DEBUG] refeHwAtb_ctrlAtbSetValueThroughMask new register value %08x\n", newRegisterValue);
#endif

return  newRegisterValue;

rfeHwSpi_register32_t outAtbRegister = inAtbRegister;

if ( true == setOn )
{
    // Set nBit in outAtbRegister
    outAtbRegister = rfeHwReg_util_setBit( outAtbRegister,
                                      nBit );
}
else
{
    // Clear nBit in outAtbRegister
    outAtbRegister = rfeHwReg_util_clearBit( outAtbRegister,
                                        nBit );
}

return outAtbRegister;

RFE_ERROR_GUARD
{
    // When the SW unit is booted up we need to ensure that stored config for ATB are default
    if ( rfeHwAtb_operationMode_notSet_e == atbMaster[currentAtbXMaster].atbCurrentOperationMode )
    {
        // Set mode of operation to no set
        atbMaster[currentAtbXMaster].atbCurrentOperationMode = rfeHwAtb_operationMode_notSet_e;
        // Initialization of the usage of trimming resistors
        atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentBusSettings.atbTrimminResistor = rfeHwAtb_trimmingResistor_diconnected;
        // Initialization of the usage of cross-talk
        atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentBusSettings.atbCrossSwitch = rfeHwAtb_crossSwitch_direction_none_e;
        // Initialization of the usage of ADC average mode
        atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentBusSettings.atbAdc.adcAverageMode = rfeHwAtb_adcAverageMode_unset_e;
        // Initialization of the usage of ADC end mode
        atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentBusSettings.atbAdc.adcEndingMode = rfeHwAtb_adcEndMode_unSet_e;
    }
    else
    {
        // Nothing, the ATB has already an operation mode set
    }
}

/* Before enabling ATBxMaster for the IP in currentIdModule,
 * we need to disable this atb bus from the previous IP that was using it
 * So first we read the ATB_CTL of previous IP, update its ATB_CTL to disable
 * ATB usage and write it back via SPI
 *
 */
if ( ipToConnect.id != atbMaster[currentAtbXMaster].atbCurrentIp.id)
{
    rfeHwAtb_ctrlAtbDisConnectToIpModule(currentAtbXMaster,
                                          RFE_ERROR_FUNCTION_ARGUMENT );
}
else
{
    /* We will have to update the data of the IP that wants to connect to ATB,
       but this has to happen for both cases so we do outside
    */
}

// Read current configuration for ATB
rfeHwSpi_register32_t atbCTL = rfeHwSpi_read( ipToConnect.id,
                                              RFE_HW_ATB_COMMON_ATB_CTL_REGISTER,
                                              RFE_ERROR_FUNCTION_ARGUMENT );
RFE_ERROR_GUARD
{
    // Check which ATBx Master bus to enable
    if( (currentAtbXMaster == rfeHwAtb_atbMaster_1_e) || (currentAtbXMaster == rfeHwAtb_atbMaster_2_e) )
    {
        // Set ATBx_EN register to 1 to enable bus connection to IP currentIdModule
        atbCTL = rfeHwReg_util_setBit( atbCTL,
                                  (rfeHwSpi_registerBit_t) ipToConnect.atbCtlEnShf );
        // Select AtbxMaster for IP module
        atbCTL = refeHwAtb_ctrlAtbSetValueThroughMask(atbCTL, ipToConnect.atbCtlMaskToApply, atbCtlSelValue, true,ipToConnect.atbCtlSelShf );

        // Set atb counter value
        atbCTL = refeHwAtb_ctrlAtbSetValueThroughMask(atbCTL,(rfeHwSpi_register32_t) RFE_HW_ATB_COMMON_ATB_COUNTER_MSK, (rfeHwSpi_register32_t) atbCtlCounterValue, false, (uint8_t) RFE_HW_ATB_COMMON_ATB_UNUSED_VALUE );
    }
    else
    {
        RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
    }
}

RFE_ERROR_GUARD
{
    // Write register with SPI
    rfeHwSpi_write( ipToConnect.id,
                    RFE_HW_ATB_COMMON_ATB_CTL_REGISTER,
                    atbCTL,
                    RFE_ERROR_FUNCTION_ARGUMENT );
    // Update the IP that is going to connect to the ATBxMaster and the operation mode
    atbMaster[currentAtbXMaster].atbCurrentIp.id = ipToConnect.id;
    atbMaster[currentAtbXMaster].atbCurrentIp.atbCtlEnShf = ipToConnect.atbCtlSelShf;
    atbMaster[currentAtbXMaster].atbCurrentIp.atbCtlMaskToApply = ipToConnect.atbCtlMaskToApply;
    atbMaster[currentAtbXMaster].atbCurrentIp.atbCtlSelShf = ipToConnect.atbCtlSelShf;
    // Update current mod of operation
    atbMaster[currentAtbXMaster].atbCurrentOperationMode = currentModeOfOperation;
}

// Read current configuration for ATB
rfeHwSpi_register32_t atbCTL = rfeHwSpi_read( atbMaster[currentAtbXMaster].atbCurrentIp.id,
                                              RFE_HW_ATB_COMMON_ATB_CTL_REGISTER,
                                              RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    // Check which ATBx Master bus to enable
    if ( ( currentAtbXMaster == rfeHwAtb_atbMaster_1_e ) || ( currentAtbXMaster == rfeHwAtb_atbMaster_2_e ) )
    {
        // Set ATBx_EN register to 0 to disable bus connection to IP currentIdModule
        atbCTL = rfeHwReg_util_clearBit( atbCTL,
                                    ( rfeHwSpi_registerBit_t ) atbMaster[currentAtbXMaster].atbCurrentIp.atbCtlEnShf );

        // De-select AtbxMaster for IP module
        atbCTL = refeHwAtb_ctrlAtbSetValueThroughMask( atbCTL,
                                                       atbMaster[currentAtbXMaster].atbCurrentIp.atbCtlMaskToApply,
                                                       RFE_HW_ATB_COMMON_ATB_UNUSED_VALUE,
                                                       true,
                                                       atbMaster[currentAtbXMaster].atbCurrentIp.atbCtlSelShf );
        // Clear atb counter value
        atbCTL = refeHwAtb_ctrlAtbSetValueThroughMask(atbCTL,(rfeHwSpi_register32_t) RFE_HW_ATB_COMMON_ATB_COUNTER_MSK, (rfeHwSpi_register32_t) RFE_HW_ATB_COMMON_ATB_UNUSED_VALUE, false, (uint8_t) RFE_HW_ATB_COMMON_ATB_UNUSED_VALUE );
    }
    else
    {
        RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
    }
}

RFE_ERROR_GUARD
{
    // Write register with SPI
    rfeHwSpi_write( atbMaster[currentAtbXMaster].atbCurrentIp.id,
                    RFE_HW_ATB_COMMON_ATB_CTL_REGISTER,
                    atbCTL,
                    RFE_ERROR_FUNCTION_ARGUMENT );

    // Set operation mode to unused
    atbMaster[currentAtbXMaster].atbCurrentOperationMode = rfeHwAtb_operationMode_notSet_e;
    atbMaster[currentAtbXMaster].atbCurrentIp.atbCtlEnShf= (uint8_t) RFE_HW_ATB_COMMON_ATB_UNUSED_VALUE;
    atbMaster[currentAtbXMaster].atbCurrentIp.atbCtlMaskToApply= RFE_HW_ATB_COMMON_ATB_UNUSED_VALUE;
    atbMaster[currentAtbXMaster].atbCurrentIp.atbCtlSelShf = RFE_HW_ATB_COMMON_ATB_UNUSED_VALUE;
}

// Store the current switches mapping to enable inputs to ATBXMaster via SPI
rfeHwSpi_register32_t atbDcSwitches0Reg;
rfeHwSpi_register32_t atbDcSwitches1Reg;
// In case we need to enable cross-talking we need an extra register to store other end register
rfeHwSpi_register32_t atbCrossTalkDcSwitches0Reg;

// Read out current switches configuration via SPI depending on ATBXMaster
switch ( currentAtbXMaster )
{
    case rfeHwAtb_atbMaster_1_e:
        //Read the current switches mapping via SPI
        atbDcSwitches0Reg = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                           RFE_HW_ATB_ATB1_DC_SWITCHES_0_REG,
                                           RFE_ERROR_FUNCTION_ARGUMENT );
        //Read the current switches mapping for trimming resistors via SPI
        atbDcSwitches1Reg = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                           RFE_HW_ATB_ATB1_DC_SWITCHES_1_REG,
                                           RFE_ERROR_FUNCTION_ARGUMENT );
        break;
    case rfeHwAtb_atbMaster_2_e:
        //Read the current switches mapping via SPI
        atbDcSwitches0Reg = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                           RFE_HW_ATB_ATB2_DC_SWITCHES_0_REG,
                                           RFE_ERROR_FUNCTION_ARGUMENT );
        //Read the current switches mapping via SPI
        atbDcSwitches1Reg = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                           RFE_HW_ATB_ATB2_DC_SWITCHES_1_REG,
                                           RFE_ERROR_FUNCTION_ARGUMENT );
        break;
    default:
        RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e )
        ;
        break;
}

RFE_ERROR_GUARD
{
    /** Depending of the mode of operation and input source we have to enable certain switches or not.
     *   Notice that the mode of operation also enforces certain enabling certain trimming resistors
     */
    switch ( currentAtbXInputSource )
    {
        case rfeHwAtb_atbSource_dc1_e:

            // Enforce disabling swap inputs for both ATB1Master and ATB2Master
            atbDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches0Reg,
                                                           RFE_HW_ATB_ATB1_DC_SWITCHES_0_SWAP_ATBX_BIT,
                                                           false );

            // DC input (IP module) is connected to ATB ADC's
            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {
                atbDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches0Reg,
                                                               RFE_HW_ATB_ATB1_DC_SWITCHES_0_ADC_TO_DC_BIT,
                                                               setOnOrOff );
            }
            else if ( rfeHwAtb_atbMaster_2_e == currentAtbXMaster )
            {
                atbDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches0Reg,
                                                               RFE_HW_ATB_ATB2_DC_SWITCHES_0_ADC_TO_DC_BIT,
                                                               setOnOrOff );
            }
            else
            {
                //TODO: this case is when both ATB1Master and ATB2Master are enabled for the same IP
            }
            break;
        case rfeHwAtb_atbSource_ext_e:
            // TODO: for validation, this should control the EXT_P and EXT_N from ATB but not sure whether needed or not
            break;
        case rfeHwAtb_atbSource_ac1_e:
            // TODO: for validation, this should control the switching to the TX if this is still there
            break;
        case rfeHwAtb_atbSource_ac2_e:
            // TODO: for validation, this should control the direct connection of ADC to ATB unit
            break;
        case rfeHwAtb_atbSource_ac3_e:
            // TODO: for validation, this should control the RX-ADC connection to ATB unit
            break;
        case rfeHwAtb_atbSource_esd_extCurrent_e:

            //TODO: for validation, check if still valid when following validation implementation
            // External current supply is connected to OTP (ESD_N/P) to be measued by the ATB ADCfor measurement. Notice the trimming resistors have to be enabled
            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {
                if ( rfeHwAtb_trimmingResistor_diconnected != atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentBusSettings.atbTrimminResistor )
                {
                    atbDcSwitches1Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches1Reg,
                                                                   RFE_HW_ATB_ATB1_DC_SWITCHES_1_INOUT_TO_RES0_BIT,
                                                                   setOnOrOff );
                    atbDcSwitches1Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches1Reg,
                                                                   RFE_HW_ATB_ATB1_DC_SWITCHES_1_INOUT_TO_RES1_BIT,
                                                                   setOnOrOff );
                }
                else
                {
                    RFE_ERROR_SET( rfe_error_atbCurrentMeasurementWithoutResistors_e );
                }

            }
            else if ( rfeHwAtb_atbMaster_2_e == currentAtbXMaster )
            {

                if ( rfeHwAtb_trimmingResistor_diconnected != atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentBusSettings.atbTrimminResistor )
                {

                    // Enable swithch for current via Res0
                    atbDcSwitches1Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches1Reg,
                                                                   RFE_HW_ATB_ATB2_DC_SWITCHES_1_INOUT_TO_RES0_BIT,
                                                                   setOnOrOff );
                    // Enable swithch for current via Res1
                    atbDcSwitches1Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches1Reg,
                                                                   RFE_HW_ATB_ATB2_DC_SWITCHES_1_INOUT_TO_RES1_BIT,
                                                                   setOnOrOff );
                }
                else
                {
                    RFE_ERROR_SET( rfe_error_atbCurrentMeasurementWithoutResistors_e );
                }

            }
            else
            {
                // Not supported, we don't configure current mesasurement in both ATB at the same time
                RFE_ERROR_SET( rfe_error_atbNotSupported_e );
            }
            break;
        case rfeHwAtb_atbSource_dc1_intCurrent_e:

            // Enforce disabling swap inputs for both ATB1Master and ATB2Master
            atbDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches0Reg,
                                                           RFE_HW_ATB_ATB1_DC_SWITCHES_0_SWAP_ATBX_BIT,
                                                           false );

            // Internal current supply from IP module (DC bus) is connected to ATB ADC for measurement. Notice the trimming resistors have to be enabled
            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {

                if ( rfeHwAtb_trimmingResistor_diconnected != atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentBusSettings.atbTrimminResistor )
                {
                    // Enable swithch for current via Res0
                    atbDcSwitches1Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches1Reg,
                                                                   RFE_HW_ATB_ATB1_DC_SWITCHES_1_RES0_TO_DC_BIT,
                                                                   setOnOrOff );
                    // Enable swithch for current via Res1
                    atbDcSwitches1Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches1Reg,
                                                                   RFE_HW_ATB_ATB1_DC_SWITCHES_1_RES1_TO_DC_BIT,
                                                                   setOnOrOff );
                }
                else
                {
                    RFE_ERROR_SET( rfe_error_atbCurrentMeasurementWithoutResistors_e );
                }

            }
            else if ( rfeHwAtb_atbMaster_2_e == currentAtbXMaster )
            {

                if ( rfeHwAtb_trimmingResistor_diconnected != atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentBusSettings.atbTrimminResistor )
                {
                    // Enable swithch for current via Res0
                    atbDcSwitches1Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches1Reg,
                                                                   RFE_HW_ATB_ATB2_DC_SWITCHES_1_RES0_TO_DC_BIT,
                                                                   setOnOrOff );
                    // Enable swithch for current via Res1
                    atbDcSwitches1Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches1Reg,
                                                                   RFE_HW_ATB_ATB2_DC_SWITCHES_1_RES1_TO_DC_BIT,
                                                                   setOnOrOff );
                }
                else
                {
                    RFE_ERROR_SET( rfe_error_atbCurrentMeasurementWithoutResistors_e );
                }

            }
            else
            {
                // Not supported, we don't configure current mesasurement in both ATB at the same time
                RFE_ERROR_SET( rfe_error_atbNotSupported_e );
            }
            break;
        case rfeHwAtb_atbSource_esd_extVoltage_e:
            //TODO: for Dft/Validation, check if still valid when following validation implementation
            // Ensure we are in cross-switching mode and no Ip is connected
            if ( rfeHwAtb_operationMode_extVoltageTrim_e == atbMaster[currentAtbXMaster].atbCurrentOperationMode )
            {
                // External voltage supply is connected to ATB1MASTER OTP (ESD_N/P) to be measued by the ATB1MASTER ADC and also by the ATB2MASTER (cross-talk)
                if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
                {
                    // 1. Read the current switches mapping of the ATB2Master unit (aka atbCrossTalkDcSwitches0Reg)
                    atbCrossTalkDcSwitches0Reg = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                                                RFE_HW_ATB_ATB2_DC_SWITCHES_0_REG,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

                    // 2. Configure cross-talk ATB1Master to ATB2Master
                    rfeHwAtb_ctrlAtbCrossSwitchSetter( rfeHwAtb_crossSwitch_direction_atb1MasterToAbt2Master_e,
                                                       &atbDcSwitches0Reg,
                                                       &atbCrossTalkDcSwitches0Reg,
                                                       setOnOrOff,
                                                       RFE_ERROR_FUNCTION_ARGUMENT );

                    // 3. Enable OTP switches to ATB1MAster ADC
                    atbDcSwitches1Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches1Reg,
                                                                   RFE_HW_ATB_ATB1_DC_SWITCHES_1_INOUT_TO_DC_BIT,
                                                                   setOnOrOff );

                }
                else if ( rfeHwAtb_atbMaster_2_e == currentAtbXMaster )
                {

                    // 1. Read the current switches mapping of the ATB1Master unit (aka atbCrossTalkDcSwitches0Reg)
                    atbCrossTalkDcSwitches0Reg = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                                                RFE_HW_ATB_ATB1_DC_SWITCHES_0_REG,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );

                    // 2. Configure cross-talk ATB2Master to ATB1Master
                    rfeHwAtb_ctrlAtbCrossSwitchSetter( rfeHwAtb_crossSwitch_direction_atb2MasterToAbt1Master_e,
                                                       &atbDcSwitches0Reg,
                                                       &atbCrossTalkDcSwitches0Reg,
                                                       setOnOrOff,
                                                       RFE_ERROR_FUNCTION_ARGUMENT );

                    // 3. Enable OTP switches to ATB2MAster ADC
                    atbDcSwitches1Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches1Reg,
                                                                   RFE_HW_ATB_ATB2_DC_SWITCHES_1_INOUT_TO_DC_BIT,
                                                                   setOnOrOff );
                }
                else
                {
                    RFE_ERROR_SET( rfe_error_atbNotSupported_e );
                }
            }
            else
            {
                RFE_ERROR_SET( rfe_error_atbCrossTalkNotEnabled_e );
            }
            break;
        default:
            RFE_ERROR_SET( rfe_error_atbInvalidOperationalMode_e );
            break;
    }
}

RFE_ERROR_GUARD
{
    // Write back new switches mapping via SPI depending on ATBXMaster
    switch ( currentAtbXMaster )
    {
        case rfeHwAtb_atbMaster_1_e:
            //Write the current switches mapping via SPI
            rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                            RFE_HW_ATB_ATB1_DC_SWITCHES_0_REG,
                            atbDcSwitches0Reg,
                            RFE_ERROR_FUNCTION_ARGUMENT );
            //Read the current switches mapping for trimming resistors via SPI
            rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                            RFE_HW_ATB_ATB1_DC_SWITCHES_1_REG,
                            atbDcSwitches1Reg,
                            RFE_ERROR_FUNCTION_ARGUMENT );

            if ( rfeHwAtb_operationMode_extVoltageTrim_e == atbMaster[currentAtbXMaster].atbCurrentOperationMode )
            {
                //Write switcjhes mapping of the ATB2Master unit (aka atbCrossTalkDcSwitches0Reg)
                rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                                RFE_HW_ATB_ATB2_DC_SWITCHES_0_REG,
                                atbCrossTalkDcSwitches0Reg,
                                RFE_ERROR_FUNCTION_ARGUMENT );
            }
            else
            {
                // Nothing, we need to do always the above writes to configure ATB1Master
            }

            break;
        case rfeHwAtb_atbMaster_2_e:
            //Read the current switches mapping via SPI
            rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                            RFE_HW_ATB_ATB2_DC_SWITCHES_0_REG,
                            atbDcSwitches0Reg,
                            RFE_ERROR_FUNCTION_ARGUMENT );
            //Read the current switches mapping via SPI
            rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                            RFE_HW_ATB_ATB2_DC_SWITCHES_1_REG,
                            atbDcSwitches1Reg,
                            RFE_ERROR_FUNCTION_ARGUMENT );

            if ( rfeHwAtb_operationMode_extVoltageTrim_e == atbMaster[currentAtbXMaster].atbCurrentOperationMode )
            {
                //Write switches mapping of the ATB1Master unit (aka atbCrossTalkDcSwitches0Reg)
                rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                                RFE_HW_ATB_ATB1_DC_SWITCHES_0_REG,
                                atbCrossTalkDcSwitches0Reg,
                                RFE_ERROR_FUNCTION_ARGUMENT );
            }
            else
            {
                // Nothing, we need to do always the above writes to configure ATB2Master
            }
            break;
        default:
            RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            break;
    }
    // Update atb bus seleted input here to ensure that we don't have previous errors
    atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentBusSettings.atbSource = currentAtbXInputSource;
}

// Store the status for atb pull down resistors
rfeHwSpi_register32_t atbPullDownReg;

/*TODO: the register here addressed to setup pulldown registers are fake and we will need
 *      to change them once they are present in the header file, our header file is from
 *      April 15th and these resistor were added on May 21th
 */
//Read the current pulldown resgister mapping via SPI
atbPullDownReg = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                RFE_HW_ATB_PULL_DOWN_CTL_REG,
                                RFE_ERROR_FUNCTION_ARGUMENT );

switch ( currentAtbXInputSource )
{
    case rfeHwAtb_atbSource_dc1_intCurrent_e:
    case rfeHwAtb_atbSource_ext_e:
    case rfeHwAtb_atbSource_dc1_e:
        /*TODO: the register here addressed to setup pulldown registers are fake and we will need
         *      to change them once they are present in the header file, our header file is from
         *      April 15th and these resistor were added on May 21th
         */
        //Set the DC pull down resistors down
        atbPullDownReg = refeHwAtb_ctrlAtbSetValueThroughMask( atbPullDownReg,
                                                               RFE_HW_ATB_ENA_DC_PULL_DOWN_MSK,
                                                               RFE_HW_ATB_PULL_DOWN_RESISTOR_VALUE,
                                                               true,
                                                               RFE_HW_ATB_ENA_DC_PULL_DOWN_BIT_SHF );
        break;
    case rfeHwAtb_atbSource_ac1_e:
    case rfeHwAtb_atbSource_ac2_e:
    case rfeHwAtb_atbSource_ac3_e:
        /*TODO: the register here addressed to setup pulldown registers are fake and we will need
         *      to change them once they are present in the header file, our header file is from
         *      April 15th and these resistor were added on May 21th
         */
        //Set the DC pull down resistors down
        atbPullDownReg = refeHwAtb_ctrlAtbSetValueThroughMask( atbPullDownReg,
                                                               RFE_HW_ATB_ENA_AC_PULL_DOWN_MSK,
                                                               RFE_HW_ATB_PULL_DOWN_RESISTOR_VALUE,
                                                               true,
                                                               RFE_HW_ATB_ENA_AC_PULL_DOWN_BIT_SHF );
        break;
    default:
        RFE_ERROR_SET( rfe_error_atbInvalidPullDownInput_e );
        break;
}

RFE_ERROR_GUARD
{
    /*TODO: the register here addressed to setup pulldown registers are fake and we will need
     *      to change them once they are present in the header file, our header file is from
     *      April 15th and these resistor were added on May 21th
     */
    //Read the current pulldown resgister mapping via SPI
    rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                    RFE_HW_ATB_PULL_DOWN_CTL_REG,
                    atbPullDownReg,
                    RFE_ERROR_FUNCTION_ARGUMENT );
}

rfeHwSpi_register32_t atbAdcInputMuxUpdated = atbAdcInputMux;

if ( rfeHwAtb_adcEndMode_single_e == atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcEndingMode )
{
    RFE_ERROR_SET( rfe_error_none_e );
}
else
{
    RFE_ERROR_SET( rfe_error_atbAdcNotInSingleMode_e );
}

RFE_ERROR_GUARD
{
    switch ( currentAtbXMaster )
    {
        case rfeHwAtb_atbMaster_1_e:
            // Select the ground for Single mode
            if ( rfeHwAtb_muxVNegSeSel_vssa_1v8_e == adcSingleModeGround )
            {
                // Set ATB ADC MUX_N -> TODO: what to set here? Do we keep it floating?
                // Set ATB ADC MUX_VNEG_SE
                atbAdcInputMuxUpdated = refeHwAtb_ctrlAtbSetValueThroughMask( atbAdcInputMuxUpdated,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_VNEG_SE_MSK,
                                                                              ( rfeHwSpi_register32_t ) rfeHwAtb_muxVNegSeSel_vssa_1v8_e,
                                                                              true,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_VNEG_SE_SHF );
            }
            else if ( rfeHwAtb_muxVNegSeSel_adc_vn_vneg_se_e == adcSingleModeGround )
            {
                // Set ATB ADC MUX_N
                atbAdcInputMuxUpdated = refeHwAtb_ctrlAtbSetValueThroughMask( atbAdcInputMuxUpdated,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VN_MSK,
                                                                              ( rfeHwSpi_register32_t ) rfeHwAtb_muxNSel_vin_vn_vneg_se_e,
                                                                              true,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VN_SHF );
                // Set ATB ADC MUX_VNEG_SE
                atbAdcInputMuxUpdated = refeHwAtb_ctrlAtbSetValueThroughMask( atbAdcInputMuxUpdated,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_VNEG_SE_MSK,
                                                                              ( rfeHwSpi_register32_t ) rfeHwAtb_muxVNegSeSel_adc_vn_vneg_se_e,
                                                                              true,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_VNEG_SE_SHF );
            }
            else if ( rfeHwAtb_muxVNegSeSel_adc_vp_vneg_se_e == adcSingleModeGround )
            {
                // Set ATB ADC MUX_P
                atbAdcInputMuxUpdated = refeHwAtb_ctrlAtbSetValueThroughMask( atbAdcInputMuxUpdated,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VP_MSK,
                                                                              ( rfeHwSpi_register32_t ) rfeHwAtb_muxNSel_vin_vn_vneg_se_e,
                                                                              true,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VP_SHF );
                // Set ATB ADC MUX_VNEG_SE
                atbAdcInputMuxUpdated = refeHwAtb_ctrlAtbSetValueThroughMask( atbAdcInputMuxUpdated,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_VNEG_SE_MSK,
                                                                              ( rfeHwSpi_register32_t ) rfeHwAtb_muxVNegSeSel_adc_vp_vneg_se_e,
                                                                              true,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_VNEG_SE_SHF );
            }
            else
            {
                RFE_ERROR_SET( rfe_error_atbInvalidAdcSingleModeGround_e );
            }
            break;
        case rfeHwAtb_atbMaster_2_e:
            // Select the ground for Single mode
            if ( rfeHwAtb_muxVNegSeSel_vssa_1v8_e == adcSingleModeGround )
            {
                // Set ATB ADC MUX_N -> TODO: what to set here? Do we keep it floating?
                // Set ATB ADC MUX_VNEG_SE
                atbAdcInputMuxUpdated = refeHwAtb_ctrlAtbSetValueThroughMask( atbAdcInputMuxUpdated,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_VNEG_SE_MSK,
                                                                              ( rfeHwSpi_register32_t ) rfeHwAtb_muxVNegSeSel_vssa_1v8_e,
                                                                              true,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_VNEG_SE_SHF );
            }
            else if ( rfeHwAtb_muxVNegSeSel_adc_vn_vneg_se_e == adcSingleModeGround )
            {
                // Set ATB ADC MUX_N
                atbAdcInputMuxUpdated = refeHwAtb_ctrlAtbSetValueThroughMask( atbAdcInputMuxUpdated,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VN_MSK,
                                                                              ( rfeHwSpi_register32_t ) rfeHwAtb_muxNSel_vin_vn_vneg_se_e,
                                                                              true,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VN_SHF );
                // Set ATB ADC MUX_VNEG_SE
                atbAdcInputMuxUpdated = refeHwAtb_ctrlAtbSetValueThroughMask( atbAdcInputMuxUpdated,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_VNEG_SE_MSK,
                                                                              ( rfeHwSpi_register32_t ) rfeHwAtb_muxVNegSeSel_adc_vn_vneg_se_e,
                                                                              true,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_VNEG_SE_SHF );
            }
            else if ( rfeHwAtb_muxVNegSeSel_adc_vp_vneg_se_e == adcSingleModeGround )
            {
                // Set ATB ADC MUX_P
                atbAdcInputMuxUpdated = refeHwAtb_ctrlAtbSetValueThroughMask( atbAdcInputMuxUpdated,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VP_MSK,
                                                                              ( rfeHwSpi_register32_t ) rfeHwAtb_muxPSel_vin_vp_vneg_se_e,
                                                                              true,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VP_SHF );
                // Set ATB ADC MUX_VNEG_SE
                atbAdcInputMuxUpdated = refeHwAtb_ctrlAtbSetValueThroughMask( atbAdcInputMuxUpdated,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_VNEG_SE_MSK,
                                                                              ( rfeHwSpi_register32_t ) rfeHwAtb_muxVNegSeSel_adc_vp_vneg_se_e,
                                                                              true,
                                                                              RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_VNEG_SE_SHF );
            }
            else
            {
                RFE_ERROR_SET( rfe_error_atbInvalidAdcSingleModeGround_e );
            }
            break;
        default:
            RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e )
            ;
            break;
    }
}
return atbAdcInputMuxUpdated;

rfeHwSpi_register32_t maskToApplyCtrl0;
uint8_t shiftToApplyCtr0;
rfeHwSpi_register32_t maskToApplyInputMuxVn;
uint8_t shiftToApplyInputMuxVn;
rfeHwSpi_register32_t maskToApplyInputMuxVp;
uint8_t shiftToApplyInputMuxVp;

if ( rfeHwAtb_adcEndMode_single_e == atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcEndingMode )
{
    RFE_ERROR_SET( rfe_error_none_e );
}
else
{
    RFE_ERROR_SET( rfe_error_atbAdcNotInSingleMode_e );
}

if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
{
    maskToApplyCtrl0 = RFE_HW_ATB_ADC1_CTRL_0_SEL_IN_MSK;
    shiftToApplyCtr0 = RFE_HW_ATB_ADC1_CTRL_0_SEL_IN_SHF;
    maskToApplyInputMuxVn = RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VN_MSK;
    shiftToApplyInputMuxVn = RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VN_SHF;
    maskToApplyInputMuxVp = RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VP_MSK;
    shiftToApplyInputMuxVp = RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VP_SHF;
}
else if ( rfeHwAtb_atbMaster_2_e == currentAtbXMaster )
{
    maskToApplyCtrl0 = RFE_HW_ATB_ADC2_CTRL_0_SEL_IN_MSK;
    shiftToApplyCtr0 = RFE_HW_ATB_ADC2_CTRL_0_SEL_IN_SHF;
    maskToApplyInputMuxVn = RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VP_MSK;
    shiftToApplyInputMuxVn = RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VN_SHF;
    maskToApplyInputMuxVp = RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VN_MSK;
    shiftToApplyInputMuxVp = RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VP_SHF;
}
else
{
    RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
}

RFE_ERROR_GUARD
{
    switch ( adcInputSel )
    {

        case rfeHwAtb_adcSel_In_0:
            // Select input (0x00) in ADC MUX (vin[0])
            *pAtbAdcCtrl0 = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcCtrl0,
                                                                  maskToApplyCtrl0,
                                                                  ( rfeHwSpi_register32_t ) rfeHwAtb_adcSel_In_0,
                                                                  true,
                                                                  shiftToApplyCtr0 );
            // Set ATB ADC MUX_P for vin_adc[0]
            *pAtbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcInputMux,
                                                                     maskToApplyInputMuxVp,
                                                                     ( rfeHwSpi_register32_t ) rfeHwAtb_muxPSel_vin_0_e,
                                                                     true,
                                                                     shiftToApplyInputMuxVp );
            // Select the ground for Single mode
            *pAtbAdcInputMux = rfeHwAtb_ctrAtbAdcGroundSingleModeSetter( currentAtbXMaster,
                                                                         adcSingleModeGround,
                                                                         *pAtbAdcInputMux,
                                                                         RFE_ERROR_FUNCTION_ARGUMENT );
            break;
        case rfeHwAtb_adcSel_In_3:

            // Select input (0x11) in ADC MUX (vin[3])
            *pAtbAdcCtrl0 = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcCtrl0,
                                                                  maskToApplyCtrl0,
                                                                  ( rfeHwSpi_register32_t ) rfeHwAtb_adcSel_In_3,
                                                                  true,
                                                                  shiftToApplyCtr0 );
            // Set ATB ADC MUX_P for vin_adc[3]
            *pAtbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcInputMux,
                                                                     maskToApplyInputMuxVp,
                                                                     ( rfeHwSpi_register32_t ) rfeHwAtb_muxPSel_vin_3_e,
                                                                     true,
                                                                     shiftToApplyInputMuxVp );

            // Select the ground for Single mode
            *pAtbAdcInputMux = rfeHwAtb_ctrAtbAdcGroundSingleModeSetter( currentAtbXMaster,
                                                                         adcSingleModeGround,
                                                                         *pAtbAdcInputMux,
                                                                         RFE_ERROR_FUNCTION_ARGUMENT );
            break;

        case rfeHwAtb_adcSel_In_2:

            // Select input (0x10) in ADC MUX (vin[2])
            *pAtbAdcCtrl0 = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcCtrl0,
                                                                  maskToApplyCtrl0,
                                                                  ( rfeHwSpi_register32_t ) rfeHwAtb_adcSel_In_2,
                                                                  true,
                                                                  shiftToApplyCtr0 );
            // Set ATB ADC MUX_N for vin_adc[2]
            *pAtbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcInputMux,
                                                                     maskToApplyInputMuxVn,
                                                                     ( rfeHwSpi_register32_t ) rfeHwAtb_muxNSel_vin_2_e,
                                                                     true,
                                                                     shiftToApplyInputMuxVn );
            // Select the ground for Single mode
            *pAtbAdcInputMux = rfeHwAtb_ctrAtbAdcGroundSingleModeSetter( currentAtbXMaster,
                                                                         adcSingleModeGround,
                                                                         *pAtbAdcInputMux,
                                                                         RFE_ERROR_FUNCTION_ARGUMENT );
            break;

        case rfeHwAtb_adcSel_In_1:
            // Select input (0x01) in ADC MUX (vin[1])
            *pAtbAdcCtrl0 = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcCtrl0,
                                                                  maskToApplyCtrl0,
                                                                  ( rfeHwSpi_register32_t ) rfeHwAtb_adcSel_In_1,
                                                                  true,
                                                                  shiftToApplyCtr0 );
            // Set ATB ADC MUX_N for vin_adc[1]
            *pAtbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcInputMux,
                                                                     maskToApplyInputMuxVn,
                                                                     ( rfeHwSpi_register32_t ) rfeHwAtb_muxNSel_vin_1_e,
                                                                     true,
                                                                     shiftToApplyInputMuxVn );
            // Select the ground for Single mode
            *pAtbAdcInputMux = rfeHwAtb_ctrAtbAdcGroundSingleModeSetter( currentAtbXMaster,
                                                                         adcSingleModeGround,
                                                                         *pAtbAdcInputMux,
                                                                         RFE_ERROR_FUNCTION_ARGUMENT );
            break;

        default:
            RFE_ERROR_SET( rfe_error_atbInvalidAdcSelSingleMode_e )
            ;
            break;
    }
}

if ( rfeHwAtb_adcEndMode_differential_e == atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcEndingMode )
{
    RFE_ERROR_SET( rfe_error_none_e );
}
else
{
    RFE_ERROR_SET( rfe_error_atbAdcNotInSingleMode_e );
}
RFE_ERROR_GUARD
{
    switch ( adcInputSel )
    {
        case rfeHwAtb_adcSel_In_1:
        case rfeHwAtb_adcSel_In_0:

            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {
                /* Set the ADC internal input to use
                 * vp_adc -> vin[0] -> DACp
                 * vn_adc -> vin[1] -> DACn
                 *
                 */
                *pAtbAdcCtrl0 = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcCtrl0,
                                                                      RFE_HW_ATB_ADC1_CTRL_0_SEL_IN_MSK,
                                                                      ( rfeHwSpi_register32_t ) rfeHwAtb_adcSel_In_0,
                                                                      true,
                                                                      RFE_HW_ATB_ADC1_CTRL_0_SEL_IN_SHF );

                // Set ATB ADC MUX_P
                *pAtbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcInputMux,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VP_MSK,
                                                                         ( rfeHwSpi_register32_t ) rfeHwAtb_muxPSel_vin_0_e,
                                                                         true,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VP_SHF );
                // Set ATB ADC MUX_N
                *pAtbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcInputMux,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VN_MSK,
                                                                         ( rfeHwSpi_register32_t ) rfeHwAtb_muxNSel_vin_1_e,
                                                                         true,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VN_SHF );

            }
            else if ( rfeHwAtb_atbMaster_2_e == currentAtbXMaster )
            {
                /* Set the ADC internal input to use
                 * vp_adc -> vin[0] -> DACp
                 * vn_adc -> vin[1] -> DACn
                 *
                 */
                *pAtbAdcCtrl0 = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcCtrl0,
                                                                      RFE_HW_ATB_ADC2_CTRL_0_SEL_IN_MSK,
                                                                      ( rfeHwSpi_register32_t ) rfeHwAtb_adcSel_In_0,
                                                                      true,
                                                                      RFE_HW_ATB_ADC2_CTRL_0_SEL_IN_SHF );

                // Set ATB ADC MUX_P
                *pAtbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcInputMux,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VP_MSK,
                                                                         ( rfeHwSpi_register32_t ) rfeHwAtb_muxPSel_vin_0_e,
                                                                         true,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VP_SHF );
                // Set ATB ADC MUX_N
                *pAtbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcInputMux,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VN_MSK,
                                                                         ( rfeHwSpi_register32_t ) rfeHwAtb_muxNSel_vin_1_e,
                                                                         true,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VN_SHF );
            }
            else
            {
                RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            }

            break;
        case rfeHwAtb_adcSel_In_2:
        case rfeHwAtb_adcSel_In_3:

            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {
                /* Set the ADC internal input to use
                 * vp_adc -> vin[3] -> DACp
                 * vn_adc -> vin[2] -> DACn
                 *
                 */
                *pAtbAdcCtrl0 = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcCtrl0,
                                                                      RFE_HW_ATB_ADC1_CTRL_0_SEL_IN_MSK,
                                                                      ( rfeHwSpi_register32_t ) rfeHwAtb_adcSel_In_3,
                                                                      true,
                                                                      RFE_HW_ATB_ADC1_CTRL_0_SEL_IN_SHF );

                // Set ATB ADC MUX_P
                *pAtbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcInputMux,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VP_MSK,
                                                                         ( rfeHwSpi_register32_t ) rfeHwAtb_muxPSel_vin_3_e,
                                                                         true,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VP_SHF );
                // Set ATB ADC MUX_N
                *pAtbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcInputMux,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VN_MSK,
                                                                         ( rfeHwSpi_register32_t ) rfeHwAtb_muxNSel_vin_2_e,
                                                                         true,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_MUX_VN_SHF );
            }
            else if ( rfeHwAtb_atbMaster_2_e == currentAtbXMaster )
            {
                /* Set the ADC internal input to use
                 * vp_adc -> vin[3] -> DACp
                 * vn_adc -> vin[2] -> DACn
                 *
                 */
                *pAtbAdcCtrl0 = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcCtrl0,
                                                                      RFE_HW_ATB_ADC2_CTRL_0_SEL_IN_MSK,
                                                                      ( rfeHwSpi_register32_t ) rfeHwAtb_adcSel_In_3,
                                                                      true,
                                                                      RFE_HW_ATB_ADC2_CTRL_0_SEL_IN_SHF );

                // Set ATB ADC MUX_P
                *pAtbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcInputMux,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VP_MSK,
                                                                         ( rfeHwSpi_register32_t ) rfeHwAtb_muxPSel_vin_3_e,
                                                                         true,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VP_SHF );
                // Set ATB ADC MUX_N
                *pAtbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( *pAtbAdcInputMux,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VN_MSK,
                                                                         ( rfeHwSpi_register32_t ) rfeHwAtb_muxNSel_vin_2_e,
                                                                         true,
                                                                         RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_MUX_VN_SHF );
            }
            else
            {
                RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            }

            break;
        default:
            RFE_ERROR_SET( rfe_error_atbInvalidAdcInputDiffMode_e )
            ;
            break;

    }
}

// Read current configuration for ATBxMaster in order to configure ADCs input muxes for VNEG, MUX_P and MUX_N
rfeHwSpi_register32_t atbAdcInputMux;
// Read current configuration for ATBxMaster in order to configure ADCs single/differential input located at RFE_HW_ATB_ADC1_CTRL_0_REG
rfeHwSpi_register32_t atbAdcCtrl0;

// Read current configuration for ATBXMaster in order to configure ADCs input muxes for VNEG, MUX_P and MUX_N
atbAdcInputMux = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                RFE_HW_ATB_DC_SWITCHES_CTL_REG,
                                RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    switch ( currentAtbXMaster )
    {
        case rfeHwAtb_atbMaster_1_e:

            // Read current configuration for ATBXMaster in order to configure ADCs single/differential input located at RFE_HW_ATB_ADC1_CTRL_0_REG
            atbAdcCtrl0 = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                         RFE_HW_ATB_ADC1_CTRL_0_REG,
                                         RFE_ERROR_FUNCTION_ARGUMENT );

            // Setting ADC to disable div2 mode
            atbAdcCtrl0 = rfeHwAtb_ctrlAtbToggleBit( atbAdcCtrl0,
                                                     RFE_HW_ATB_ADC1_CTRL_0_SEL_DIV2_BIT,
                                                     false );
            // We go for single-ended
            if ( rfeHwAtb_adcEndMode_single_e == adcEndToSet )
            {

                // Setting ADC to work with single ending
                atbAdcCtrl0 = rfeHwAtb_ctrlAtbToggleBit( atbAdcCtrl0,
                                                         RFE_HW_ATB_ADC1_CTRL_0_SEL_SE_CONV_BIT,
                                                         true );


                // Store ADC signle-ended mode
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcEndingMode = adcEndToSet;

                // Set ADC to work in single-ended mode
                rfeHwAtb_ctrlAtbAdcInputSingleModeSetter( adcInputSel,
                                                          adcSingleModeGround,
                                                          currentAtbXMaster,
                                                          &atbAdcCtrl0,
                                                          &atbAdcInputMux,
                                                          RFE_ERROR_FUNCTION_ARGUMENT );
            }
            else// We go for differential mode
            {
                // Setting ADC to work with differential ending
                atbAdcCtrl0 = rfeHwAtb_ctrlAtbToggleBit( atbAdcCtrl0,
                                                         RFE_HW_ATB_ADC1_CTRL_0_SEL_SE_CONV_BIT,
                                                         false );

                // In differential mode we set ATB ADC MUX_VNEG_SE to ground (vssa_1.8v)
                atbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( atbAdcInputMux,
                                                                       RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_VNEG_SE_MSK,
                                                                       ( rfeHwSpi_register32_t ) rfeHwAtb_muxVNegSeSel_vssa_1v8_e,
                                                                       true,
                                                                       RFE_HW_ATB_DC_SWITCHES_SEL_ADC1_VNEG_SE_SHF );

                // Store ADC differential-ended mode
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcEndingMode = adcEndToSet;

                // Set ADC to work in differential-ended mode
                rfeHwAtb_ctrlAtbAdcInputDiffModeSetter( currentAtbXMaster,
                                                        adcInputSel,
                                                        &atbAdcCtrl0,
                                                        &atbAdcInputMux,
                                                        RFE_ERROR_FUNCTION_ARGUMENT );
            }
            // Check that ADC single-ended was properly set
            if( true == RFE_ERROR_IS_ERROR)
            {
                // Reset ADC ending
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcEndingMode = rfeHwAtb_adcEndMode_unSet_e;
            }
            else
            {
                // Nothing to do, we have already set the value to single-ended
            }

            break;

        case rfeHwAtb_atbMaster_2_e:

            // Read current configuration for ATBXMaster in order to configure ADCs single/differential input located at RFE_HW_ATB_ADC1_CTRL_0_REG
            atbAdcCtrl0 = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                         RFE_HW_ATB_ADC2_CTRL_0_REG,
                                         RFE_ERROR_FUNCTION_ARGUMENT );

            // Setting ADC to disable div2 mode
            atbAdcCtrl0 = rfeHwAtb_ctrlAtbToggleBit( atbAdcCtrl0,
                                                     RFE_HW_ATB_ADC2_CTRL_0_SEL_DIV2_BIT,
                                                     false );

            if ( rfeHwAtb_adcEndMode_single_e == adcEndToSet )
            {
                // Setting ADC to work with single ending
                atbAdcCtrl0 = rfeHwAtb_ctrlAtbToggleBit( atbAdcCtrl0,
                                                         RFE_HW_ATB_ADC2_CTRL_0_SEL_SE_CONV_BIT,
                                                         true );

                // Store ADC signle-ended mode
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcEndingMode = adcEndToSet;

                rfeHwAtb_ctrlAtbAdcInputSingleModeSetter( adcInputSel,
                                                          adcSingleModeGround,
                                                          currentAtbXMaster,
                                                          &atbAdcCtrl0,
                                                          &atbAdcInputMux,
                                                          RFE_ERROR_FUNCTION_ARGUMENT );

            }
            else// We go for differential mode
            {

                // Setting ADC to work with differential ending
                atbAdcCtrl0 = rfeHwAtb_ctrlAtbToggleBit( atbAdcCtrl0,
                                                         RFE_HW_ATB_ADC2_CTRL_0_SEL_SE_CONV_BIT,
                                                         false );
                // In differential mode we set ATB ADC MUX_VNEG_SE to ground (vssa_1.8v)
                atbAdcInputMux = refeHwAtb_ctrlAtbSetValueThroughMask( atbAdcInputMux,
                                                                       RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_VNEG_SE_MSK,
                                                                       ( rfeHwSpi_register32_t ) rfeHwAtb_muxVNegSeSel_vssa_1v8_e,
                                                                       true,
                                                                       RFE_HW_ATB_DC_SWITCHES_SEL_ADC2_VNEG_SE_SHF );

                // Store ADC differential-ended mode
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcEndingMode = adcEndToSet;

                // Function that configures MUX_N and MUX_ based on input towards ADC (SEL_IN)
                rfeHwAtb_ctrlAtbAdcInputDiffModeSetter( currentAtbXMaster,
                                                        adcInputSel,
                                                        &atbAdcCtrl0,
                                                        &atbAdcInputMux,
                                                        RFE_ERROR_FUNCTION_ARGUMENT );
            }

            // Check that ADC single-ended was properly set
            if( true == RFE_ERROR_IS_ERROR)
            {
                // Reset ADC ending
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcEndingMode = rfeHwAtb_adcEndMode_unSet_e;
            }
            else
            {
                // Nothing to do, we have already set the value to single-ended
            }
            break;

        default:
            RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            break;
    }
}

RFE_ERROR_GUARD
{
    // Write new configuration for ATBXMaster in order to configure ADCs input muxes for VNEG, MUX_P and MUX_N
     rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                                    RFE_HW_ATB_DC_SWITCHES_CTL_REG,
                                    atbAdcInputMux,
                                    RFE_ERROR_FUNCTION_ARGUMENT );

    switch ( currentAtbXMaster )
    {
        case rfeHwAtb_atbMaster_1_e:
            // Write new  configuration for ATBXMaster in order to configure ADCs single/differential input located at RFE_HW_ATB_ADC1_CTRL_0_REG
            rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                            RFE_HW_ATB_ADC1_CTRL_0_REG,
                            atbAdcCtrl0,
                            RFE_ERROR_FUNCTION_ARGUMENT );
            break;
        case rfeHwAtb_atbMaster_2_e:
            // Write new  configuration for ATBXMaster in order to configure ADCs single/differential input located at RFE_HW_ATB_ADC1_CTRL_0_REG
            rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                            RFE_HW_ATB_ADC2_CTRL_0_REG,
                            atbAdcCtrl0,
                            RFE_ERROR_FUNCTION_ARGUMENT );
            break;
        default:
            RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            break;
    }
}

// Read current configuration for adc for both ATBxMaster located at RFE_HW_ATB_ADC_CTL_FUNC_REG
rfeHwSpi_register32_t adcCtlFunc = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                                  RFE_HW_ATB_ADC_CTL_FUNC_REG,
                                                  RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    // Set the ADC to configure
    switch ( currentAtbXMaster )
    {
        case rfeHwAtb_atbMaster_1_e:

            // Set ATB ADC sampling rate
            adcCtlFunc = refeHwAtb_ctrlAtbSetValueThroughMask( adcCtlFunc,
                                                               RFE_HW_ATB_ADC_CTL_FUNC_ADC1_CLOCK_DIV_MSK,
                                                               ( rfeHwSpi_register32_t ) adcSamplingRate,
                                                               true,
                                                               RFE_HW_ATB_ADC_CTL_FUNC_ADC1_CLOCK_DIV_SHF );

            // Set ATB ADC duty cycle  if asked for or if the sampling rate is set to 2.5MSamples/s
            if ( (rfeHwAtb_adcDutyCycle_75_e == adcDutyCycle ) || ( rfeHwAtb_adcSamplingRate_2p5M_e == adcSamplingRate) )
            {
                adcCtlFunc = rfeHwReg_util_setBit( adcCtlFunc,
                                              RFE_HW_ATB_ADC_CTL_FUNC_ADC1_DUTY_CYCLE_SEL_BIT );
            }
            else
            {
                adcCtlFunc = rfeHwReg_util_clearBit( adcCtlFunc,
                                                RFE_HW_ATB_ADC_CTL_FUNC_ADC1_DUTY_CYCLE_SEL_BIT );
            }
            // Enables ATB ADC avaraging  on or off
            if ( rfeHwAtb_adcAverageEnable_enabled_e == adcAveragedEnabled )
            {
                adcCtlFunc = rfeHwReg_util_setBit( adcCtlFunc,
                                              RFE_HW_ATB_ADC_CTL_FUNC_ADC1_AVE_EN_BIT );
            }
            else
            {
                adcCtlFunc = rfeHwReg_util_clearBit( adcCtlFunc,
                                                RFE_HW_ATB_ADC_CTL_FUNC_ADC1_AVE_EN_BIT );
            }

            /**
             * Set ATB ADC avaraging mode Cont or Mono depending on how adcAveragedEnabled was set.
             * Notice that in Mono mode the number of samples are fixed to 1 sample if averaging is disabled
             */
            if ( ( rfeHwAtb_adcAverageEnable_enabled_e == adcAveragedEnabled ) && ( rfeHwAtb_adcAverageMode_cont_e == adcAveragingMode ) )
            {
                adcCtlFunc = rfeHwReg_util_setBit( adcCtlFunc,
                                              RFE_HW_ATB_ADC_CTL_FUNC_ADC1_CONT_MONO_BIT );
                // Upadate with ADC averaging mode
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageMode = adcAveragingMode;
                // Update the samples to use
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcSamplesToAverage = adcSamplesToAverage;
            }
            else
            {
                // MONO mode
                adcCtlFunc = rfeHwReg_util_clearBit( adcCtlFunc,
                                                RFE_HW_ATB_ADC_CTL_FUNC_ADC1_CONT_MONO_BIT );
                // Upadate with ADC averaging mode
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageMode = rfeHwAtb_adcAverageMode_mono_e;
                if( rfeHwAtb_adcAverageEnable_enabled_e == adcAveragedEnabled )
                {
                    // Only one sample available
                    atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcSamplesToAverage = adcSamplesToAverage;
                }
                else
                {
                    // Only one sample available
                    atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcSamplesToAverage = rfeHwAtb_adcAveragingOn_1samples_e;
                }
            }
            break;

        case rfeHwAtb_atbMaster_2_e:

            // Set ATB ADC sampling rate
            adcCtlFunc = refeHwAtb_ctrlAtbSetValueThroughMask( adcCtlFunc,
                                                               RFE_HW_ATB_ADC_CTL_FUNC_ADC2_CLOCK_DIV_MSK,
                                                               ( rfeHwSpi_register32_t ) adcSamplingRate,
                                                               true,
                                                               RFE_HW_ATB_ADC_CTL_FUNC_ADC2_CLOCK_DIV_SHF );

            // Set ATB ADC duty cycle to 75% if asked for or if the sampling rate is set to 2.5MSamples/s
            if ( (rfeHwAtb_adcDutyCycle_75_e == adcDutyCycle ) || ( rfeHwAtb_adcSamplingRate_2p5M_e == adcSamplingRate) )
            {
                adcCtlFunc = rfeHwReg_util_setBit( adcCtlFunc,
                                              RFE_HW_ATB_ADC_CTL_FUNC_ADC2_DUTY_CYCLE_SEL_BIT );
            }
            else
            {
                adcCtlFunc = rfeHwReg_util_clearBit( adcCtlFunc,
                                                RFE_HW_ATB_ADC_CTL_FUNC_ADC2_DUTY_CYCLE_SEL_BIT );
            }
            // Enables ATB ADC avaraging  on or off
            if ( rfeHwAtb_adcAverageEnable_enabled_e == adcAveragedEnabled )
            {
                adcCtlFunc = rfeHwReg_util_setBit( adcCtlFunc,
                                              RFE_HW_ATB_ADC_CTL_FUNC_ADC2_AVE_EN_BIT );

                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageEnabled = rfeHwAtb_adcAverageEnable_enabled_e;
            }
            else
            {
                adcCtlFunc = rfeHwReg_util_clearBit( adcCtlFunc,
                                                RFE_HW_ATB_ADC_CTL_FUNC_ADC2_AVE_EN_BIT );
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageEnabled = rfeHwAtb_adcAverageEnable_disabled_e;
            }
            /**
             * Set ATB ADC avaraging mode Cont or Mono depending on how adcAveragedEnabled was set.
             * Notice that in Mono mode the number of samples are fixed to 1 sample if averaging is disabled
             * */
            if ( ( rfeHwAtb_adcAverageEnable_enabled_e == adcAveragedEnabled ) && ( rfeHwAtb_adcAverageMode_cont_e == adcAveragingMode ) )
            {
                adcCtlFunc = rfeHwReg_util_setBit( adcCtlFunc,
                                              RFE_HW_ATB_ADC_CTL_FUNC_ADC2_CONT_MONO_BIT );
                // Upadate with ADC averaging mode
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageMode = adcAveragingMode;
                // Update the samples to use
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcSamplesToAverage = adcSamplesToAverage;
            }
            else
            {
                // MONO mode
                adcCtlFunc = rfeHwReg_util_clearBit( adcCtlFunc,
                                                RFE_HW_ATB_ADC_CTL_FUNC_ADC2_CONT_MONO_BIT );
                // Upadate with ADC averaging mode
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageMode = rfeHwAtb_adcAverageMode_mono_e;
                if( rfeHwAtb_adcAverageEnable_enabled_e == adcAveragedEnabled )
                {
                    // Only one sample available
                    atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcSamplesToAverage = adcSamplesToAverage;
                }
                else
                {
                    // Only one sample available
                    atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcSamplesToAverage = rfeHwAtb_adcAveragingOn_1samples_e;
                }
            }

            break;

        default:
            RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            break;
    }

}

RFE_ERROR_GUARD
{
    // Write register with SPI
    rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                    RFE_HW_ATB_ADC_CTL_FUNC_REG,
                    adcCtlFunc,
                    RFE_ERROR_FUNCTION_ARGUMENT );

    // SAmpling rate
    atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcCurrentSamplingRate = adcSamplingRate;
    // DUty cycle
    atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcCurrentDutyCycle = adcDutyCycle;
    // Upadate with ADC sampling rate
    atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcCurrentSamplingRate = adcSamplingRate;
    // Upadate with ADC enabling averaging
    atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageEnabled = adcAveragedEnabled;

}

// Read current configuration for adc for both ATBxMaster located at RFE_HW_ATB_ADC_CTL_FUNC_REG
rfeHwSpi_register32_t adcCtlFunc = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                                  RFE_HW_ATB_ADC_CTL_FUNC_REG,
                                                  RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{

    /** Set ATB ADC avaraging mode Cont or Mono depending on how adcAveragedEnabled was set.
     Notice that in Mono mode we don't change whether averaging is enabled or not, that has
     to be done via rfeHwAtb_ctrlAtbAdcBasicSettingsSetter()*/
    switch ( currentAtbXMaster )
    {
        case rfeHwAtb_atbMaster_1_e:

            // We need to enable the ADC clock before any sampling, in MONO mode by changing this bit will enable the acquisition
            adcCtlFunc = rfeHwReg_util_setBit( adcCtlFunc,
                                          RFE_HW_ATB_ADC_CTL_FUNC_ADC1_CLOCK_EN_BIT );

            // We go into CONT mode
            if ( rfeHwAtb_adcAverageMode_cont_e == adcMode )
            {
                // For CONT mode we need RFE_HW_ATB_ADC_CTL_FUNC_ADC1_AVE_EN_BIT always on
                adcCtlFunc = rfeHwReg_util_setBit( adcCtlFunc,
                                              RFE_HW_ATB_ADC_CTL_FUNC_ADC1_AVE_EN_BIT );

                // Set ADC1_CONT_MONO_BIT so that we work in CONT mode
                adcCtlFunc = rfeHwReg_util_setBit( adcCtlFunc,
                                              RFE_HW_ATB_ADC_CTL_FUNC_ADC1_CONT_MONO_BIT );

                // Upadate with ADC averaging mode
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageMode = rfeHwAtb_adcAverageMode_cont_e;
                // Update with ADC averaging enabled
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageEnabled = rfeHwAtb_adcAverageEnable_enabled_e;
            }
            else
            {
                // Clear ADC1_CONT_MONO_BIT so we work in mono mode
                adcCtlFunc = rfeHwReg_util_clearBit( adcCtlFunc,
                                                RFE_HW_ATB_ADC_CTL_FUNC_ADC1_CONT_MONO_BIT );
                // Upadate with ADC averaging mode
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageMode = rfeHwAtb_adcAverageMode_mono_e;
            }
            break;

        case rfeHwAtb_atbMaster_2_e:
            // We need to enable the ADC clock before any sampling, in MONO mode by changing this bit will enable the acquisition
            adcCtlFunc = rfeHwReg_util_setBit( adcCtlFunc,
                                          RFE_HW_ATB_ADC_CTL_FUNC_ADC2_CLOCK_EN_BIT );

            if ( rfeHwAtb_adcAverageMode_cont_e == adcMode )
            {
                // For CONT mode we need RFE_HW_ATB_ADC_CTL_FUNC_ADC2_AVE_EN_BIT always on
                adcCtlFunc = rfeHwReg_util_setBit( adcCtlFunc,
                                              RFE_HW_ATB_ADC_CTL_FUNC_ADC2_AVE_EN_BIT );
                // Set ADC2_CONT_MONO_BIT so that we work in CONT mode
                adcCtlFunc = rfeHwReg_util_setBit( adcCtlFunc,
                                              RFE_HW_ATB_ADC_CTL_FUNC_ADC2_CONT_MONO_BIT );
                // Upadate with ADC averaging mode
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageMode = rfeHwAtb_adcAverageMode_cont_e;
                // Update with ADC averaging enabled
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageEnabled = rfeHwAtb_adcAverageEnable_enabled_e;
            }
            else
            {
                adcCtlFunc = rfeHwReg_util_clearBit( adcCtlFunc,
                                                RFE_HW_ATB_ADC_CTL_FUNC_ADC2_CONT_MONO_BIT );
                // Upadate with ADC averaging mode
                atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageMode = rfeHwAtb_adcAverageMode_mono_e;
            }
            break;
        default:
            RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e ) ;
            break;
    }
}

RFE_ERROR_GUARD
{
    // Write register with SPI
    rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                    RFE_HW_ATB_ADC_CTL_FUNC_REG,
                    adcCtlFunc,
                    RFE_ERROR_FUNCTION_ARGUMENT );
}

/** 1 Read BandGap register config */
// Read current Band gap register
rfeHwSpi_register32_t atbBandGapReg0 = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                                      RFE_HW_ATB_PVT_REF_GEN_BIST_0_REG,
                                                      RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    /** 2. Enable Level shifters     -> Handled in other function
     3. Enable ADC Level shifters -> Handled in other function
     */

    /** 4. Set BandGap (BG0V9) */
    // Enable bandgap circuit
    atbBandGapReg0 = rfeHwAtb_ctrlAtbToggleBit( atbBandGapReg0,
                                                RFE_HW_ATB_PVT_REF_GEN_BIST_0_ENA_BG_BIT,
                                                true );
    // Feed DC voltage to bandgap circuit
    atbBandGapReg0 = refeHwAtb_ctrlAtbSetValueThroughMask( atbBandGapReg0,
                                                           RFE_HW_ATB_PVT_REF_GEN_BIST_0_TR_BG_SETDC_MSK,
                                                           RFE_HW_ATB_BAND_GAP_DC_VALUE,
                                                           true,
                                                           RFE_HW_ATB_PVT_REF_GEN_BIST_0_TR_BG_SETDC_SHF );
    // Feed curvature to bandgap circuit
    atbBandGapReg0 = refeHwAtb_ctrlAtbSetValueThroughMask( atbBandGapReg0,
                                                           RFE_HW_ATB_PVT_REF_GEN_BIST_0_TR_BG_SETCUR_MSK,
                                                           RFE_HW_ATB_BAND_GAP_CUR_VALUE,
                                                           true,
                                                           RFE_HW_ATB_PVT_REF_GEN_BIST_0_TR_BG_SETCUR_SHF );
    // Bypass the RC filter
    atbBandGapReg0 = rfeHwAtb_ctrlAtbToggleBit( atbBandGapReg0,
                                                RFE_HW_ATB_PVT_REF_GEN_BIST_0_BYPASS_BG_RC_BIT,
                                                true );
    // Enable the bandgap buffer
    atbBandGapReg0 = rfeHwAtb_ctrlAtbToggleBit( atbBandGapReg0,
                                                RFE_HW_ATB_PVT_REF_GEN_BIST_0_ENA_BG_BUF_BIT,
                                                true );
    // Disable the BIST buffer // TODO: needed for the Bist?
    atbBandGapReg0 = rfeHwAtb_ctrlAtbToggleBit( atbBandGapReg0,
                                                RFE_HW_ATB_PVT_REF_GEN_BIST_0_ENA_BIST_BUF_BIT,
                                                false );
    // Mux to select bandgap outptu voltage
    atbBandGapReg0 = refeHwAtb_ctrlAtbSetValueThroughMask( atbBandGapReg0,
                                                           RFE_HW_ATB_PVT_REF_GEN_BIST_0_MUX_SEL_MSK,
                                                           ( rfeHwSpi_register32_t ) bandGapVoutToSet,
                                                           false,
                                                           0u );
    // Bypass BIST RC filter // TODO: needed for the Bist?
    atbBandGapReg0 = rfeHwAtb_ctrlAtbToggleBit( atbBandGapReg0,
                                                RFE_HW_ATB_PVT_REF_GEN_BIST_0_BYPASS_BIST_RC_BIT,
                                                false );

    // Write atbBandGapReg0 register with SPI
    rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                    RFE_HW_ATB_PVT_REF_GEN_BIST_0_REG,
                    atbBandGapReg0,
                    RFE_ERROR_FUNCTION_ARGUMENT );

    /** 5. Wait for acknowledge that the BandGap is set properly */
    // TODO: need to make usage of the controlled loop but they are not ready yet...
    rfeHwSpi_register32_t atbBandGapStatusReg;
    uint32_t myTimeOut = 150ul;
    do
    {
        atbBandGapStatusReg = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                             RFE_HW_ATB_BG_STATUS_BG_OK_FLAG_BIT,
                                             RFE_ERROR_FUNCTION_ARGUMENT );
    }
    while ( ( 0x1ul != atbBandGapStatusReg ) || ( myTimeOut < RFE_HW_ATB_BAND_GAP_SETTLING_TIMEOUT ) );

    if ( 0x1ul == atbBandGapStatusReg )
    {
        RFE_ERROR_SET( rfe_error_none_e );

        // When the SW unit is booted up we need to ensure that stored config for ATB are default
        rfeHwAtb_initAtbConfigStruct( rfeHwAtb_atbMaster_1_e,
                                      RFE_ERROR_FUNCTION_ARGUMENT );
        rfeHwAtb_initAtbConfigStruct( rfeHwAtb_atbMaster_2_e,
                                      RFE_ERROR_FUNCTION_ARGUMENT );
    }
    else
    {
        RFE_ERROR_SET( rfe_error_atbBandGapNotStarted_e );
    }
}

//Read the current trimming resistors values via SPI, only needed once since it contains info for both ATBxMaster
rfeHwSpi_register32_t adcDcTrimResReg = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                                       RFE_HW_ATB_ATB_DC_TRIM_RES_REG,
                                                       RFE_ERROR_FUNCTION_ARGUMENT );
RFE_ERROR_GUARD
{
    // Set selected trimming resistor value
    switch ( atbResistorToSet )
    {
        case rfeHwAtb_trimmingResistor_res0:
            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {

                // Set ATB1Master Res0 trimming value
                adcDcTrimResReg = refeHwAtb_ctrlAtbSetValueThroughMask( adcDcTrimResReg,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES0_ATB1_MSK,
                                                                        adcDcTrimRes0Value,
                                                                        false,
                                                                        0u );
            }
            else
            {
                // Set ATB2Master Res0 trimming value
                adcDcTrimResReg = refeHwAtb_ctrlAtbSetValueThroughMask( adcDcTrimResReg,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES0_ATB2_MSK,
                                                                        adcDcTrimRes0Value,
                                                                        true,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES0_ATB2_SHF );
            }
            break;

        case rfeHwAtb_trimmingResistor_res1:

            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {
                // Set ATB1Master Res1 trimming value
                adcDcTrimResReg = refeHwAtb_ctrlAtbSetValueThroughMask( adcDcTrimResReg,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES1_ATB1_MSK,
                                                                        adcDcTrimRes1Value,
                                                                        true,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES1_ATB1_SHF );
            }
            else
            {
                // Set ATB2Master Res1 trimming value
                adcDcTrimResReg = refeHwAtb_ctrlAtbSetValueThroughMask( adcDcTrimResReg,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES1_ATB2_MSK,
                                                                        adcDcTrimRes1Value,
                                                                        true,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES1_ATB2_SHF );
            }
            break;

        case rfeHwAtb_trimmingResistor_res0And1:

            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {

                // Set ATB1Master Res0 trimming value
                adcDcTrimResReg = refeHwAtb_ctrlAtbSetValueThroughMask( adcDcTrimResReg,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES0_ATB1_MSK,
                                                                        adcDcTrimRes0Value,
                                                                        false,
                                                                        0u );
                // Set ATB1Master Res1 trimming value
                adcDcTrimResReg = refeHwAtb_ctrlAtbSetValueThroughMask( adcDcTrimResReg,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES1_ATB1_MSK,
                                                                        adcDcTrimRes1Value,
                                                                        true,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES1_ATB1_SHF );
            }
            else
            {
                // Set ATB2Master Res0 trimming value
                adcDcTrimResReg = refeHwAtb_ctrlAtbSetValueThroughMask( adcDcTrimResReg,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES0_ATB2_MSK,
                                                                        adcDcTrimRes0Value,
                                                                        true,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES0_ATB2_SHF );
                // Set ATB2Master Res1 trimming value
                adcDcTrimResReg = refeHwAtb_ctrlAtbSetValueThroughMask( adcDcTrimResReg,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES1_ATB2_MSK,
                                                                        adcDcTrimRes1Value,
                                                                        true,
                                                                        RFE_HW_ATB_ATB_DC_TRIM_RES_SET_RES1_ATB2_SHF );
            }
            break;

        default:
            RFE_ERROR_SET( rfe_error_atbInvalidTrimmingSelectedResistor_e );
            break;
    }
}

RFE_ERROR_GUARD
{
    //Write new trimming resistors values via SPI
    rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                   RFE_HW_ATB_ATB_DC_TRIM_RES_REG,
                   adcDcTrimResReg,
                   RFE_ERROR_FUNCTION_ARGUMENT );
}

//Sotore the current switches mapping to enable trimming resistors via SPI
rfeHwSpi_register32_t atbDcSwitches0Reg;
RFE_ERROR_GUARD
{
    // Read out current switches mapping to enable trimming resistors via SPI depending on ATBXMaster
    switch ( currentAtbXMaster )
    {
        case rfeHwAtb_atbMaster_1_e:
            //Read the current switches mapping for trimming resistors via SPI
            atbDcSwitches0Reg = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                               RFE_HW_ATB_ATB1_DC_SWITCHES_0_REG,
                                               RFE_ERROR_FUNCTION_ARGUMENT );
            break;
        case rfeHwAtb_atbMaster_2_e:
            //Read the current switches mapping for trimming resistors via SPI
            atbDcSwitches0Reg = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                               RFE_HW_ATB_ATB2_DC_SWITCHES_0_REG,
                                               RFE_ERROR_FUNCTION_ARGUMENT );
            break;
        default:
            RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            break;
    }
}

RFE_ERROR_GUARD
{
    // Enable the selected trimming resistor
    switch ( atbResistorToEnable )
    {
        case rfeHwAtb_trimmingResistor_res0:
            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {

                // Enable Res0 in ATB1Master depending on setOnOrOff
                atbDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches0Reg,
                                                               RFE_HW_ATB_ATB1_DC_SWITCHES_0_RES0_TO_ADC_BIT,
                                                               setOnOrOff );
            }
            else
            {

                // Enable Res0 in ATB2Master depending on setOnOrOff
                atbDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches0Reg,
                                                               RFE_HW_ATB_ATB2_DC_SWITCHES_0_RES0_TO_ADC_BIT,
                                                               setOnOrOff );

            }
            break;

        case rfeHwAtb_trimmingResistor_res1:

            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {

                // Enable Res1 in ATB1Master depending on setOnOrOff
                atbDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches0Reg,
                                                               RFE_HW_ATB_ATB1_DC_SWITCHES_0_RES1_TO_ADC_BIT,
                                                               setOnOrOff );

            }
            else
            {
                // Enable Res1 in ATB1Master depending on setOnOrOff
                atbDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches0Reg,
                                                               RFE_HW_ATB_ATB2_DC_SWITCHES_0_RES1_TO_ADC_BIT,
                                                               setOnOrOff );
            }
            break;

        case rfeHwAtb_trimmingResistor_res0And1:

            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {

                // Enable Res0 and Res1 in ATB1Master depending on setOnOrOff
                atbDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches0Reg,
                                                               RFE_HW_ATB_ATB1_DC_SWITCHES_0_RES0_TO_ADC_BIT,
                                                               setOnOrOff );
                // Enable Res0 and Res1 in ATB1Master depending on setOnOrOff
                atbDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches0Reg,
                                                               RFE_HW_ATB_ATB1_DC_SWITCHES_0_RES1_TO_ADC_BIT,
                                                               setOnOrOff );
            }
            else
            {
                // Enable Res0 and Res1 in ATB2Master depending on setOnOrOff
                atbDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches0Reg,
                                                               RFE_HW_ATB_ATB2_DC_SWITCHES_0_RES0_TO_ADC_BIT,
                                                               setOnOrOff );
                // Enable Res0 and Res1 in ATB2Master depending on setOnOrOff
                atbDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( atbDcSwitches0Reg,
                                                               RFE_HW_ATB_ATB2_DC_SWITCHES_0_RES1_TO_ADC_BIT,
                                                               setOnOrOff );
            }
            break;

        default:
            RFE_ERROR_SET( rfe_error_atbInvalidTrimmingSelectedResistor_e );
            break;
    }
}

RFE_ERROR_GUARD
{

    switch ( currentAtbXMaster )
    {
        case rfeHwAtb_atbMaster_1_e:
            //Write new switches mapping for trimming resistors via SPI
            rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                            RFE_HW_ATB_ATB1_DC_SWITCHES_0_REG,
                            atbDcSwitches0Reg,
                            RFE_ERROR_FUNCTION_ARGUMENT );
            break;
        case rfeHwAtb_atbMaster_2_e:
            //Write new switches mapping for trimming resistors via SPI
            rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                            RFE_HW_ATB_ATB2_DC_SWITCHES_0_REG,
                            atbDcSwitches0Reg,
                            RFE_ERROR_FUNCTION_ARGUMENT );
            break;
        default:
            RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            break;
    }
    if( true == setOnOrOff)
    {
        // Store the enabled trimming resistors
        atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentBusSettings.atbTrimminResistor = atbResistorToEnable;
    }
    else
    {
        // Store the enabled trimming resistors
        atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentBusSettings.atbTrimminResistor = rfeHwAtb_trimmingResistor_diconnected;
    }


}

// Read current configuration for buffer for both ATBxMaster located at ATB_RF_BUF_1
rfeHwSpi_register32_t atbRfBuf1 = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                                 RFE_HW_ATB_RF_BUF_1_REG,
                                                 RFE_ERROR_FUNCTION_ARGUMENT );
RFE_ERROR_GUARD
{
    // Enable power to the RF Buffer
    rfeHwReg_util_setBit( atbRfBuf1,
                     RFE_HW_ATB_RF_BUF_1_ENA_RF_BUF_BIT );
    //TODO: check whether something more has to be enabled here apart from setting the RF Buffer power, maybe settings?

    // Enable the buffer in the requested ATBxMaster
    switch ( currentAtbXMaster )
    {
        case rfeHwAtb_atbMaster_1_e:

            atbRfBuf1 = rfeHwReg_util_setBit( atbRfBuf1,
                                         RFE_HW_ATB_RF_BUF_1_ENA_RF1_TO_RFINT_BIT );
            break;

        case rfeHwAtb_atbMaster_2_e:

            atbRfBuf1 = rfeHwReg_util_setBit( atbRfBuf1,
                                         RFE_HW_ATB_RF_BUF_1_ENA_RF2_TO_RFINT_BIT );
            break;

        default:
            RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            break;
    }
}

RFE_ERROR_GUARD
{

    // Store that we use the buffering
    atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentBusSettings.atbAcBuffering = rfeHwAtb_acInput_buffered_e;

    // Write register with SPI
    rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                    RFE_HW_ATB_RF_BUF_1_REG,
                    atbRfBuf1,
                    RFE_ERROR_FUNCTION_ARGUMENT );
}

RFE_ERROR_GUARD
{
    if (rfeHwAtb_crossSwitch_direction_atb1MasterToAbt2Master_e == crossSwitchDirection)
    {
        /** Both Sides
         * 1. Swap ADC input in both ATB1Master and ATB2Master
         * */
        //TODO: HW Question Crossswitch mode: swap ADC inputs. Is this call enough to swap inputs for both ATB's? THere is no other swap filed in the register map
        *pAtbSrcDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( *pAtbSrcDcSwitches0Reg,
                                                            RFE_HW_ATB_ATB1_DC_SWITCHES_0_SWAP_ATBX_BIT,
                                                       setOnOrOff );

        /** ATB1Master Side
         * 1.Enable that ATB1Master input source EXT_P/N so that this input is forwarded to ATB2Master via ADC_TO_EXT
         * */
        // Enable that OTP voltages, ESD_P and ESD_N, are forwarded to the ATB2Master via EXT_P and EXT_N.
        *pAtbSrcDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( *pAtbSrcDcSwitches0Reg,
                                                       RFE_HW_ATB_ATB1_DC_SWITCHES_0_ADC_TO_EXT_BIT,
                                                       setOnOrOff );

        /** ATB2Master Side
         * 1.Enable origin ATB1Master voltage from EXT_P/N via ADC_TO_EXT to ATB2Master ADC
         * 2.Enable origin ATB1Master voltage from EXT_P/N via ADC_TO_EXT to ATB2Master EXT_P/N
         * */
        *pAtbDstDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( *pAtbDstDcSwitches0Reg,
                                                       RFE_HW_ATB_ATB2_DC_SWITCHES_0_ADC_TO_EXT_BIT,
                                                       setOnOrOff );
        *pAtbDstDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( *pAtbDstDcSwitches0Reg,
                                                         RFE_HW_ATB_ATB2_DC_SWITCHES_0_INOUT_TO_ADC_BIT,
                                                       setOnOrOff );

    }
    else if(rfeHwAtb_crossSwitch_direction_atb2MasterToAbt1Master_e == crossSwitchDirection)
    {
        /** Both Sides
         * 1. Swap ADC input in both ATB2Master and ATB1Master
         * */
        //TODO: HW Question Crossswitch mode: swap ADC inputs. Is this call enough to swap inputs for both ATB's? THere is no other swap filed in the register map
        *pAtbSrcDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( *pAtbSrcDcSwitches0Reg,
                                                            RFE_HW_ATB_ATB1_DC_SWITCHES_0_SWAP_ATBX_BIT,
                                                       setOnOrOff );

        /** ATB2Master Side
         * 1.Enable that ATB2Master input source EXT_P/N so that this input is forwarded to ATB1Master via ADC_TO_EXT
         * */
        // Enable that OTP voltages, ESD_P and ESD_N, are forwarded to the ATB2Master via EXT_P and EXT_N.
        *pAtbSrcDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( *pAtbSrcDcSwitches0Reg,
                                                       RFE_HW_ATB_ATB2_DC_SWITCHES_0_ADC_TO_EXT_BIT,
                                                       setOnOrOff );

        /** ATB1Master Side
         * 1.Enable origin ATB2Master voltage from EXT_P/N via ADC_TO_EXT to ATB1Master ADC
         * 2.Enable origin ATB2Master voltage from EXT_P/N via ADC_TO_EXT to ATB1Master EXT_P/N
         * */
        *pAtbDstDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( *pAtbDstDcSwitches0Reg,
                                                       RFE_HW_ATB_ATB1_DC_SWITCHES_0_ADC_TO_EXT_BIT,
                                                       setOnOrOff );
        *pAtbDstDcSwitches0Reg = rfeHwAtb_ctrlAtbToggleBit( *pAtbDstDcSwitches0Reg,
                                                         RFE_HW_ATB_ATB1_DC_SWITCHES_0_INOUT_TO_ADC_BIT,
                                                       setOnOrOff );
    }
}

