                            RFE_HW_ATB_ADC2_CTRL_1_REG,
                            atbAdc2Ctrl1Reg,
                            RFE_ERROR_FUNCTION_ARGUMENT );
        }
        break;

    default:
        RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
        break;
}

/** 1. Read ATB BandGap register config */
rfeHwSpi_register32_t atbBandGapReg1 = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                                      RFE_HW_ATB_PVT_REF_GEN_BIST_1_REG,
                                                      RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    // Check which ATBx Master bus to enable
    switch ( currentAtbXMaster )
    {
        case rfeHwAtb_atbMaster_1_e:
            // Enable ADC, notice that we negate input flag since the ADC works with low active signal
            atbBandGapReg1 = rfeHwAtb_ctrlAtbToggleBit( atbBandGapReg1,
                                       RFE_HW_ATB_PVT_REF_GEN_BIST_1_ENA_ADC_ATB1_BIT,
                                       !powerOn );//TODO:HW Question ADC Power: the enable of ADC is inverted? So zero is enabling the ADC?
            break;

        case rfeHwAtb_atbMaster_2_e:
            // Enable ADC, notice that we negate input flag since the ADC works with low active signal
            atbBandGapReg1 = rfeHwAtb_ctrlAtbToggleBit( atbBandGapReg1,
                                       RFE_HW_ATB_PVT_REF_GEN_BIST_1_ENA_ADC_ATB2_BIT,
                                       !powerOn );//TODO:HW Question ADC Power: the enable of ADC is inverted? So zero is enabling the ADC?
            break;

        case rfeHwAtb_atbMaster_1And2_e:
            // TODO: for the review, is this needed? Or if we want both ATB up we can just call this function twice with the corresponding input right?
            // Enable ADC, notice that we negate input flag since the ADC works with low active signal
            atbBandGapReg1 = rfeHwAtb_ctrlAtbToggleBit( atbBandGapReg1,
                                       RFE_HW_ATB_PVT_REF_GEN_BIST_1_ENA_ADC_ATB1_BIT,
                                       !powerOn );//TODO:HW Question ADC Power: the enable of ADC is inverted? So zero is enabling the ADC?
            // Enable ADC, notice that we negate input flag since the ADC works with low active signal
            atbBandGapReg1 = rfeHwAtb_ctrlAtbToggleBit( atbBandGapReg1,
                                       RFE_HW_ATB_PVT_REF_GEN_BIST_1_ENA_ADC_ATB2_BIT,
                                       !powerOn );//TODO:HW Question ADC Power: the enable of ADC is inverted? So zero is enabling the ADC?
            break;

        default:
            RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            break;
    }
}

RFE_ERROR_GUARD
{
    rfeHwSpi_write( RFE_HW_SPI_ATB_MODULE,
                    RFE_HW_ATB_PVT_REF_GEN_BIST_1_REG,
                    atbBandGapReg1,
                    RFE_ERROR_FUNCTION_ARGUMENT );

    /** 5. Wait till the ADC is enabled */
    // TODO: need to make usage of the controlled loop but they are not ready yet...
    uint32_t myTimeOut = 10ul;
    do
    {
        //wait and update myTimeOut
    } while ( myTimeOut < RFE_HW_ATB_ADC_ENABLED_TIMEOUT );

    // Set ADC configuration as un-defined to be checked
    atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageMode = rfeHwAtb_adcAverageMode_unset_e;
}

RFE_ERROR_GUARD
{

    // Enable ATB switches accordingly to the mode of operation set
    switch ( currentModeOfOperation )
    {
        case rfeHwAtb_operationMode_ipDcUsage_e:

            // TODO: take into account the case where we come from another mode of  operatio, then
            // we should do a reset/clear all the current settings before using this mode

            /** Sequence using DC Bus
             * 1. Power up the ATB and enable ADC level shifters, power up bandgap unit - if booting
             * 2. Connect IP to DC bus - we check that previous IP module is disconected before
             * 3. Disable pull down lines in ATB
             * 4. Connect DC input source to ATB, route IP-DC to ADC
             * 5. Enable trimming resistors?
             * 6. Power up ADC
             * 7. Configure ADC for sampling
             * 8. Trigger ADC sampling
             * 9. Collect results of ADC sampling
             */

            /** 1. Power up ATB
             *     If we power up, we set the initial operation mode to not set within this function
             * */
            rfeHwAtb_ctrlAtbPowerOn(
            RFE_ERROR_FUNCTION_ARGUMENT );

            rfeHwAtb_ctrlAtbBandGapPowerOn( rfeHwAtb_bandGapVoltages_unfilteredTap_0V_e,
                                            RFE_ERROR_FUNCTION_ARGUMENT );

            /** 2. Connet IP to DC bus
             *     Notice that this function will check and disconnect previous IP connected to ATB DC bus
             * */
//                rfeHwAtb_ctrlAtbConnectToIpModule( currentIdModule,
//                                                   currentAtbXMaster,
//                                                   currentModeOfOperation,
//                                                   RFE_ERROR_FUNCTION_ARGUMENT );

            /** 3. Disable pull down lines in ATB
             *
             */
            rfeHwAtb_ctrAtbPullDownLinesSetter( rfeHwAtb_atbSource_dc1_e,
                                                RFE_ERROR_FUNCTION_ARGUMENT );

            /** 4. Connect DC input source to ATBxMaster, route IP-DC to ADC
             * */
            rfeHwAtb_ctrlAtbInputSourceSetter( currentAtbXMaster,
                                               rfeHwAtb_atbSource_dc1_e,
                                               true,
                                               RFE_ERROR_FUNCTION_ARGUMENT );

            /** 5. Enable trimming resistors?
             *     By default we are disabling trimming resistor when using DC bus
             */
            rfeHwAtb_ctrlAtbTrimmingResistorsEnable( currentAtbXMaster,
                                                     rfeHwAtb_trimmingResistor_diconnected,
                                                     false,
                                                     RFE_ERROR_FUNCTION_ARGUMENT );

            /** 6. Power up ADC
             * */
            rfeHwAtb_ctrlAtbAdcPowerOn( currentAtbXMaster,
                                        true,
                                        RFE_ERROR_FUNCTION_ARGUMENT );

            /** 7. Configure ADC for sampling
             *
             */
            rfeHwAtb_ctrlAtbAdcAverageModeSetter( currentAtbXMaster,
                                                  rfeHwAtb_adcAverageMode_cont_e,
                                                  RFE_ERROR_FUNCTION_ARGUMENT );

            rfeHwAtb_ctrlAtbAdcBasicSettingsSetter( currentAtbXMaster,
                                                    adcSamplingRate,
                                                    rfeHwAtb_adcDutyCycle_50_e,
                                                    adcAveragedEnabled,
                                                    rfeHwAtb_adcAverageMode_cont_e,
                                                    adcSamplesToAverage,
                                                    RFE_ERROR_FUNCTION_ARGUMENT );

            break;
        case rfeHwAtb_operationMode_ipAcUsage_e:
            // TODO: for Dft/Validation
            /** Sequence using AC Bus
             * 1. Power up the ATB
             * 2. Enable or not IF buffer
             * 3. Disable pull down lines in ATB
             * 3. Connect AC input source to ATB, route IP-AC to ADC
             * 4. Enable trimming resistors?
             * 5. Power up ADC
             * 6. Configure ADC for sampling
             * 7. Trigger ADC sampling
             * 8. Collect results of ADC sampling
             */
            break;
        case rfeHwAtb_operationMode_extCrurrenTrim_e:
            // TODO: for Dft/Validation
            /** Sequence to measure external current
             * 1. Power up the ATB
             * 2. Connect OTP input source to ATB,route voltage to ADC
             * 3. Enable trimming resistors
             * 4. Power up ADC
             * 5. Configure ADC for sampling
             * 6. Trigger ADC sampling
             * 7. Collect results of ADC sampling
             */
            break;
        case rfeHwAtb_operationMode_intCurrentTrim_e:
            /** Sequence to measure internal current
             * 1. Power up the ATB
             * 2. Connect current generator to DC bus
             * 3. Disable pull down lines in ATB
             * 3. Connect DC input source to ATB, route IP-DC to ADC
             * 4. Enable trimming resistors
             * 5. Power up ADC
             * 6. Configure ADC for sampling
             * 7. Trigger ADC sampling
             * 8. Collect results of ADC sampling
             */

            /** 1. Power up ATB
             *     If we power up, we set the initial operation mode to not set within this function
             * */
            rfeHwAtb_ctrlAtbPowerOn(
            RFE_ERROR_FUNCTION_ARGUMENT );

            rfeHwAtb_ctrlAtbBandGapPowerOn( rfeHwAtb_bandGapVoltages_unfilteredTap_0V_e,
                                            RFE_ERROR_FUNCTION_ARGUMENT );

            /** 2. Connet IP to DC bus
             *     Notice that this function will check and disconnect previous IP connected to ATB DC bus
             * */
//                rfeHwAtb_ctrlAtbConnectToIpModule( currentIdModule,
//                                                   currentAtbXMaster,
//                                                   rfeHwAtb_operationMode_intCurrentTrim_e,
//                                                   RFE_ERROR_FUNCTION_ARGUMENT );

            /** 3. Disable pull down lines in ATB
             *
             */
            rfeHwAtb_ctrAtbPullDownLinesSetter( rfeHwAtb_atbSource_dc1_e,
                                                RFE_ERROR_FUNCTION_ARGUMENT );

            /** 4. Connect DC input source to ATBxMaster, route currentFromIP@DC to ADC
             * */
            rfeHwAtb_ctrlAtbInputSourceSetter( currentAtbXMaster,
                                               rfeHwAtb_atbSource_dc1_e,
                                               true,
                                               RFE_ERROR_FUNCTION_ARGUMENT );

            /** 5. Enable trimming resistors, we are measuring current
             *
             */
            rfeHwAtb_ctrlAtbTrimmingResistorsEnable( currentAtbXMaster,
                                                     rfeHwAtb_trimmingResistor_diconnected,
                                                     true,
                                                     RFE_ERROR_FUNCTION_ARGUMENT );

            /** 6. Power up ADC
             * */
            rfeHwAtb_ctrlAtbAdcPowerOn( currentAtbXMaster,
                                        true,
                                        RFE_ERROR_FUNCTION_ARGUMENT );

            /** 7. Configure ADC for sampling
             *
             */
            rfeHwAtb_ctrlAtbAdcAverageModeSetter( currentAtbXMaster,
                                                  rfeHwAtb_adcAverageMode_cont_e,
                                                  RFE_ERROR_FUNCTION_ARGUMENT );

            rfeHwAtb_ctrlAtbAdcBasicSettingsSetter( currentAtbXMaster,
                                                    adcSamplingRate,
                                                    rfeHwAtb_adcDutyCycle_50_e,
                                                    adcAveragedEnabled,
                                                    rfeHwAtb_adcAverageMode_cont_e,
                                                    adcSamplesToAverage,
                                                    RFE_ERROR_FUNCTION_ARGUMENT );

            break;
        case rfeHwAtb_operationMode_extVoltageTrim_e:
            // TODO: for Dft/Validation
            /** Sequence to measure external voltaget
             * 1. Power up the ATB
             * 2. Connect OTP input source to ATB, route voltage to ADC
             * 3. Connect DC input source to ATB, route IP-DC to ADC
             * 4. Enable trimming resistors?
             * 5. Enable cross-talking for ATBSrcMaster to ATBDstMaster
             * 6. Power up ATBSrcMaster ADC
             * 7. Power up ATBDstMaster ADC
             * 8. Configure ATBSrcMasterADC for sampling
             * 9. Configure ATBDstMasterADC for sampling
             * 10. Trigger ATBSrcMaster ADC sampling
             * 11. Trigger ATBDstMaster ADC sampling
             * 12. Collect results of ATBSrcMaster ADC sampling
             * 13. Collect results of ATBDstMaster ADC sampling
             */
            break;
        default:
            RFE_ERROR_SET( rfe_error_atbInvalidOperationalMode_e )
            ;
            break;
    }

}

// Aux value not to modify orignal
rfeHwSpi_register32_t registerValueToGet = atbRegWithValue;

// Do we need shift?
if( true == shiftNeeded)
{
    registerValueToGet = ( registerValueToGet & ~maskToApply )  >> shiftToApply ;
}
else
{
    registerValueToGet =  registerValueToGet & ~maskToApply ;
}

#ifdef RFE_HW_ATB_DEBUG
sim_printf("[DEBUG] refeHwAtb_ctrlAtbGetValueThroughMask called on register %08x with bitmask %08x  and bit shift of %08x\n", atbRegWithValue, maskToApply, shiftToApply);
sim_printf("[DEBUG] refeHwAtb_ctrlAtbGetValueThroughMask register value %08x\n", registerValueToGet);
#endif

return  registerValueToGet;

if ( rfeHwAtb_operationMode_notSet_e == atbMaster[currentAtbXMaster].atbCurrentOperationMode )
{
    RFE_ERROR_SET( rfe_error_atbModeOfOperationNotSet_e );
}
else if ( rfeHwAtb_adcAverageMode_unset_e == atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageMode )
{
    RFE_ERROR_SET( rfe_error_atbAdcNotConfiguredToSample_e );
}
else
{
    RFE_ERROR_SET( rfe_error_none_e );
}

RFE_ERROR_GUARD
{
    // Trigger CONT mode or not
    if( true == startStopSampling)
    {
        rfeHwAtb_ctrlAtbAdcAverageModeSetter( currentAtbXMaster,
                                              rfeHwAtb_adcAverageMode_cont_e,
                                              RFE_ERROR_FUNCTION_ARGUMENT);
    }
    else
    {
        rfeHwAtb_ctrlAtbAdcAverageModeSetter( currentAtbXMaster,
                                              rfeHwAtb_adcAverageMode_mono_e,
                                              RFE_ERROR_FUNCTION_ARGUMENT);
    }
}

if ( rfeHwAtb_operationMode_notSet_e == atbMaster[currentAtbXMaster].atbCurrentOperationMode )
{
    RFE_ERROR_SET( rfe_error_atbModeOfOperationNotSet_e );
}
else if ( rfeHwAtb_adcAverageMode_unset_e == atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageMode )
{
    RFE_ERROR_SET( rfe_error_atbAdcNotConfiguredToSample_e );
}
else
{
    RFE_ERROR_SET( rfe_error_none_e );
}

RFE_ERROR_GUARD
{
    if ( true == enableWaitForSamples )
    {
        // Variable to hold the time to wait for samples
        uint32_t tToWaitForSamplesReady;

        // Based on the congifured ADC clock set the time to wait
        if ( rfeHwAtb_adcSamplingRate_5M_e == atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcCurrentSamplingRate )
        {
            tToWaitForSamplesReady = RFE_HW_ATB_ADC_TS_AT_FS_5_MHZ;
        }
        else if ( rfeHwAtb_adcSamplingRate_2p5M_e == atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcCurrentSamplingRate )
        {
            // Fs = 2.5MS/s = 1/2 * 5MS/s -> ts = 1/Fs = 4us = 2 * 2us
            tToWaitForSamplesReady = RFE_HW_ATB_ADC_TS_AT_FS_5_MHZ * 2ul;
        }
        else
        {
            // TODO: this RFE_HW_ATB_ADC_TS_AT_FS_4_MHZ is not correct since it should be defined as 1/4MHz = 0.25e-6
            tToWaitForSamplesReady = RFE_HW_ATB_ADC_TS_AT_FS_4_MHZ;
        }
        // If we are in Mono averaged mode we wait 16*Fs, if we are in Mono non-averaging we have to wait 1*Fs
        if ( rfeHwAtb_adcAverageEnable_enabled_e == atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageEnabled )
        {
            tToWaitForSamplesReady *= ( uint32_t ) rfeHwAtb_adcAveragingOn_16samples6_e;
        }
        else
        {
            tToWaitForSamplesReady *= ( uint32_t ) rfeHwAtb_adcAveragingOn_1samples_e;
        }

        // To trigger a new MONO conversion we have just to re-enable the clock of the ADC
        rfeHwAtb_ctrlAtbAdcAverageModeSetter( currentAtbXMaster,
                                              rfeHwAtb_adcAverageMode_mono_e,
                                              RFE_ERROR_FUNCTION_ARGUMENT );

        /*TODO: replace this loop with the guarded loop once ready
         *      With the guarded loops we have a minimum time resolution of  1us or 2 us
         *      However we will have an issue because the RFE_WAIT_USEC only accepts integers what happens if we need fractionals as we do?
         *      Min -> tToWaitForSamplesReady = 1*(1/5e6)*1e6 = 0.2//us
         *      Max -> tToWaitForSamplesReady =16*(1/2.5e6)*1e6 =  6.4//us
         */
        //RFE_WAIT_USEC( tToWaitForSamplesReady )
    }
    else
    {
        // To trigger a new MONO conversion we have just to re-enable the clock of the ADC
        rfeHwAtb_ctrlAtbAdcAverageModeSetter( currentAtbXMaster,
                                              rfeHwAtb_adcAverageMode_mono_e,
                                              RFE_ERROR_FUNCTION_ARGUMENT );
    }

}

// Variable to hold register value
rfeHwSpi_register32_t registerWitData;
// SAmples contained in the register
rfeHwSpi_register32_t samples = 0xFFFFFFFFul;

// Auxiliary variables to read register
rfeHwSpi_register32_t regToRead;
rfeHwSpi_register32_t maskToApply;
uint8_t shiftToApply;

RFE_ERROR_GUARD
{
    switch ( adcSamplesToAverage )
    {
        case rfeHwAtb_adcAveragingOn_1samples_e:
            // Read data from OBS1
            regToRead = RFE_HW_ATB_ADC_OBS1_REG;
            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {
                maskToApply = RFE_HW_ATB_ADC_OBS1_ADC1_DATA_OUT_MSK;
                shiftToApply = RFE_HW_ATB_ADC_OBS1_ADC1_DATA_OUT_SHF;
            }
            else if ( rfeHwAtb_atbMaster_2_e == currentAtbXMaster )
            {
                maskToApply = RFE_HW_ATB_ADC_OBS1_ADC2_DATA_OUT_MSK;
                shiftToApply = RFE_HW_ATB_ADC_OBS1_ADC2_DATA_OUT_SHF;
            }
            else
            {
                RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            }
            break;
        case rfeHwAtb_adcAveragingOn_2samples_e:
            // Read data from OBS2
            regToRead = RFE_HW_ATB_ADC_AVE_OBS2_REG;
            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {
                maskToApply = RFE_HW_ATB_ADC_AVE_OBS2_ADC1_DATA_OUT_2_MSK;
                shiftToApply = RFE_HW_ATB_ADC_AVE_OBS2_ADC1_DATA_OUT_2_SHF;
            }
            else if ( rfeHwAtb_atbMaster_2_e == currentAtbXMaster )
            {
                maskToApply = RFE_HW_ATB_ADC_AVE_OBS2_ADC2_DATA_OUT_2_MSK;
                shiftToApply = RFE_HW_ATB_ADC_AVE_OBS2_ADC2_DATA_OUT_2_SHF;
            }
            else
            {
                RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            }
            break;
        case rfeHwAtb_adcAveragingOn_4samples_e:
            // Read data from OBS4
            regToRead = RFE_HW_ATB_ADC_AVE_OBS4_REG;
            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {
                maskToApply = RFE_HW_ATB_ADC_AVE_OBS4_ADC1_DATA_OUT_4_MSK;
                shiftToApply = RFE_HW_ATB_ADC_AVE_OBS4_ADC1_DATA_OUT_4_SHF;
            }
            else if ( rfeHwAtb_atbMaster_2_e == currentAtbXMaster )
            {
                maskToApply = RFE_HW_ATB_ADC_AVE_OBS4_ADC2_DATA_OUT_4_MSK;
                shiftToApply = RFE_HW_ATB_ADC_AVE_OBS4_ADC2_DATA_OUT_4_SHF;
            }
            else
            {
                RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            }
            break;
        case rfeHwAtb_adcAveragingOn_8samples_e:
            // Read data from OBS8
            regToRead = RFE_HW_ATB_ADC_AVE_OBS8_REG;
            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {
                maskToApply = RFE_HW_ATB_ADC_AVE_OBS8_ADC1_DATA_OUT_8_MSK;
                shiftToApply = RFE_HW_ATB_ADC_AVE_OBS8_ADC1_DATA_OUT_8_SHF;
            }
            else if ( rfeHwAtb_atbMaster_2_e == currentAtbXMaster )
            {
                maskToApply = RFE_HW_ATB_ADC_AVE_OBS8_ADC2_DATA_OUT_8_MSK;
                shiftToApply = RFE_HW_ATB_ADC_AVE_OBS8_ADC2_DATA_OUT_8_SHF;
            }
            else
            {
                RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            }
            break;
        case rfeHwAtb_adcAveragingOn_16samples6_e:
            // Read data from OBS16
            regToRead = RFE_HW_ATB_ADC_AVE_OBS16_REG;
            if ( rfeHwAtb_atbMaster_1_e == currentAtbXMaster )
            {
                maskToApply = RFE_HW_ATB_ADC_AVE_OBS16_ADC1_DATA_OUT_16_MSK;
                shiftToApply = RFE_HW_ATB_ADC_AVE_OBS16_ADC1_DATA_OUT_16_SHF;
            }
            else if ( rfeHwAtb_atbMaster_2_e == currentAtbXMaster )
            {
                maskToApply = RFE_HW_ATB_ADC_AVE_OBS16_ADC2_DATA_OUT_16_MSK;
                shiftToApply = RFE_HW_ATB_ADC_AVE_OBS16_ADC2_DATA_OUT_16_SHF;
            }
            else
            {
                RFE_ERROR_SET( rfe_error_atbInvalidAtbMaster_e );
            }
            break;
        default:
            RFE_ERROR_SET( rfe_error_atbAdcInvalidAveragingSamples_e );
            break;
    }
}

RFE_ERROR_GUARD
{
    // Read the register holding the samples
    registerWitData = rfeHwSpi_read( RFE_HW_SPI_ATB_MODULE,
                                     regToRead,
                                     RFE_ERROR_FUNCTION_ARGUMENT );

    // For the read register, data has to be extracted
    samples = refeHwAtb_ctrlAtbGetValueThroughMask( registerWitData,
                                                 maskToApply,
                                                 true,
                                                 shiftToApply );
}
return samples;

/* Variable to hold data of the register, we initialize it to a value that is not possible,
 * all ADC samples are 12bits based
 */
rfeHwSpi_register32_t sample = 0xFFFFFFFFul;

if ( rfeHwAtb_adcAverageMode_cont_e == atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageMode )
{
    sample =  rfeHwAtb_funcAtbReadRegister( currentAtbXMaster,
                                         atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcSamplesToAverage,
                                         RFE_ERROR_FUNCTION_ARGUMENT );
}
else if ( rfeHwAtb_adcAverageMode_mono_e == atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageMode )
{
    if ( rfeHwAtb_adcAverageEnable_enabled_e == atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcAverageEnabled )
    {
        // In Mono average mode we allow to read all averaged samples
        sample = rfeHwAtb_funcAtbReadRegister( currentAtbXMaster,
                                             atbMaster[currentAtbXMaster].atbCurrentSettings.atbCurrentAdcSettings.adcSamplesToAverage,
                                             RFE_ERROR_FUNCTION_ARGUMENT );
    }
    else
    {
        // With Mono averaged disabled, we are only allow to read the 1 sample
        sample = rfeHwAtb_funcAtbReadRegister( currentAtbXMaster,
                                             rfeHwAtb_adcAveragingOn_1samples_e,
                                             RFE_ERROR_FUNCTION_ARGUMENT );
    }
}
else
{
    RFE_ERROR_SET( rfe_error_atbAdcNotConfiguredToSample_e );
}

return sample;
